足を化学薬品等から保護するためにブーツの上から着用するケミカルプロテクション(科学防護) オーバーブーツです。
ラバー素材で縫い目の無い構造のため高い防水性を誇り、内部への液体侵入を防ぎます。<br><br>

お求めやすい価格ですので気兼ねなく使用していただけますし、一時的に防水が必要な場合にもすぐに着用していただけます。<br><br>

サイズ８のみですが、お値打ち特価が魅力の商品です、サイズはブーツの形状により異なりますが、大体２５～２６センチくらいまで対応すると思います。<br><br>

・サイズ：8（25cm～26cmサイズのブーツに対応）<br>
・アウトソールサイズ：約30.5cm（靴底外側のつま先から踵まで計測）<br>
※オーバーブーツですのでインソールは入っておりません。<br>
・ゴムバンド３点留め<br>
・カラー：オリーブドラブ<br>
・コンディション：未使用品<br>
・重量：705g（片足／サイズ8）<br>
・原産国：アメリカ<br><br>

<font color="FF0000">※コントラクトナンバー無し<br><br>

※未使用品ですがややヨゴレがございますので予めご了承下さい。</font><br><style>

